INSERT INTO `block_custom` VALUES ('1', '<div class=\"about_company_content\">\r\n<p>株洲千金药业股份有限公司，前身为株洲市中药厂，1993年进行股份制改造，2004年上市（股票代码：600479），2005年，“千金”商标被认定为中国驰名商标。千金药业系国家大中型中药制药企业。旗下拥有十三家控股子公司。 </p>\r\n <br/>\r\n<p>千金药业注册资本3.05亿元，2013年底，总资产达到18.88亿元。经济效益综合指标在湖南省医药行业同行中排名第一，位居国内中药行业前列。</p>\r\n  <br/>\r\n<p>公司拥有国内最大、工艺最成熟的中药片剂生产线，日产量为1200万片，年产量可达35亿片。硬件装备先进，达到国内领先水平。2009年12月，位于河西天元区栗雨工业园的千金女性健康产业基地正式投产，该基地建设属国家高新技术产业项目，占地200亩达产规模30亿元。   </p>\r\n  <br/>\r\n<p>公司专注于女性健康产业，已形成女性健康系列产品。公司现有片剂、颗粒剂、硬胶囊剂等八个剂型，十三条生产线，全部通过GMP认证。主要产品有：妇科千金片（胶囊）、补血益母颗粒、养阴清肺糖浆、千金椿乳凝胶、痛经宁糖浆（胶囊）、乳癖康胶囊妇科调经片、千金宁洗液、千金止带丸、八珍益母片、加味逍遥丸、乳泉颗粒等。</p>\r\n  <br/>\r\n<p>公司现有14个独家产品，近50个生产批文，拥有各项专利206件。其中主导产品妇科千金片（胶囊）是国家中药保护品种、国家基本药物，国家医保目录甲类品种，《中国药典》收载品种，国家秘密技术项目，是唯一列入国家秘密技术的妇科中成药品种。</p>\r\n  <br/>\r\n<p>千金药业及下属子公司现有员工4000余人，其中总部员工1800余人，大专以上学历人员超过52%，平均年龄为29岁，在职职业药师40余名。公司建立了近千人的专业化特质营销队伍，在全国除西藏、台湾、香港、澳门外的30多个省市设有联络处。</p>\r\n  <br/>\r\n<p>公司“十二五”战略目标是：成为女性健康领域标杆企业，成为中药衍生领域品牌产品；实现集团公司年销售收入达40亿元；实现员工收入增长翻番；使千金药业成为“快乐千金”、“和谐千金”、“富裕千金”和“品牌千金”。</p>\r\n\r\n\r\n</div>', '关于千金药业', 'full_html');
INSERT INTO `block_custom` VALUES ('2', '<div class=\"about_company_content\">\r\n<p>湖南千金卫生用品股份有限公司是株洲千金药业股份有限公司的子公司，成立于2011年6月，公司致力于打造中国医学级卫生棉品品牌。</p>\r\n<br/>\r\n<p>核心产品千金净雅妇科专用棉巾是中国目前唯一的医疗器械号卫生巾。 其表层采用100%纯净千金棉，融合千金药业独特保密技术，具有纯棉、无菌、抑菌、预防感染等产品优势。为女性细嫩肌肤，提供了天然而清爽的保护屏障，从而有效减低妇科疾病的发病机率。 </p>\r\n<br/>\r\n<p>千金净雅妇科专用棉巾核心功能：</p>\r\n<br/>\r\n<p>预防：千金净雅通过消除细菌源、抑制细菌生长、融千金药业独特技术，促使体内经血排得更干净，从里到外达到预防经期感染，降低妇科疾病发病率；</p>\r\n<br/>\r\n<p>无菌：整体消毒，四重灭菌（原材料、环境、制造过程、整体灭菌），彻底杀死细菌源，达到零真菌零细菌品质保证;</p>\r\n<br/>\r\n<p>纯棉：100%千金棉亲肤无刺激，透气防过敏。</p>\r\n<br/>\r\n</div>', '关于千金静雅', 'full_html');
INSERT INTO `block_custom` VALUES ('3', '<div class=\"contact_us_content\">\r\n<p class=\"p_titel\">市场理念</p>\r\n<p>公司在人力资源管理中强化市场取向,使人力资源管理越来越多地折射出市场的法则和规律, 坚持市场化人力资源的理念,形成“进得来、出得去、留得住”的用人机制，建立市场体制下的劳动关系，即主体平等、双向选择、合理流动。公司和员工间的劳动关系，从确立到终结的过程，主要通过双方选择机制、竞争上岗机制、人才开发机制、薪酬分配机制、激励和约束机制来完成，实现员工成长和公司竞争力增强双赢。</p>\r\n<br >\r\n<p class=\"p_titel\">开放理念</p>\r\n<p>公司的发展坚持开放的人才引进理念，统筹开发利用公司内外人才资源，以“开放包容、强力吸引、不分地域、绩优则才”的原则，大力吸引国内外高层次人才来公司工作。真正形成公司人才辈出、人尽其才、才尽其用的发展格局。</p>\r\n<br >\r\n<p class=\"p_titel\">经营理念</p>\r\n<p>公司树立“人力资源是企业发展的第一资源”的思想，推进人力资源开发和经营理念。人力资源经营理念的价值在于正确认识人在劳动中的地位，使企业由对人的管理与控制向人力资本的开发与经营转变，公司通过建立清晰的人力资源战略规划、健全的人力资源组织、完全可测量的人力资源经营的业绩指标评价体系和先进的信息技术应用的人力资源体系来确保这一理念在公司管理中得以实施、发挥作用，实现人力资本价值最大化，使人力资源部门从纯粹的管理部门转变为“管理+经营”部门。</p>\r\n<br >\r\n<p class=\"p_titel\">服务理念</p>\r\n<p>员工是实现经济目标的要素，是具有自身需求和社会价值的个体。公司通过各职能部门管理和服务履行职责，保障员工权益，密切管理层与员工关系，激发员工工作积极性，改变公司管理的面貌，促进公司蓬勃发展，更好地实现公司的预定目标。</p>\r\n<br >\r\n<p class=\"p_titel\">团队理念</p>\r\n<p>团队理念是大局意识、协作精神和服务精神的集中体现。公司团队理念的基础是尊重个人的兴趣和成就，核心是协同合作，是全体员工的向心力、凝聚力，反映的是个人利益和公司利益的统一，营造相互信任的组织氛围，建立有效的沟通机制，充分发挥团队的潜能，进而保证公司的高效率运转。</p>\r\n <br >\r\n<p class=\"p_titel\">人才理念</p>\r\n<p>人才是企业发展之本、竞争之本。公司视人才为企业第一资源，把依靠人才作为企业发展的根本前提，把尊重人才作为企业发展的根本准则，把推进企业和员工共同发展作为人才战略的根本任务。同时，通过各种有效途径，不断提高企业人才的综合素养，促进企业与员工的共同发展，让员工分享企业发展成果。</p>\r\n<br >\r\n\r\n</div>', '联系我们', 'full_html');
INSERT INTO `block_custom` VALUES ('4', '<div class=\"club_content\">\r\n<h3>湖南千金卫生用品股份有限公司</h3>\r\n<br />\r\n<p>湖南千金卫生用品股份有限公司是妇科中药领域领军企业株洲千金药业股份有限公司的子公司，成立于2011年6月.是千金药业“十二五”计划中“品牌千金”的重要战略部署，公司主要专注于研发、生产、销售医用级卫生棉品，是国内首家医用级卫生棉品制造商。它以天然为基，以医学为魂，依托其独家“千金棉”科技，带来专业、权威、健康的卫生棉品。 其核心材料“千金棉”—融千金药业独特技术，用100%纯天然棉花经水刺无纺工艺制作。公司生产妇科、产科、婴童、家居生活、妆护、日常清洁六大系列产品，100多个品种，功能性产品能起到降低女性妇科病的发病率，对提升女性健康、改善生活品质具有划时代的意义。 </p>\r\n<br >\r\n<p>公司拥有一支有经验、有朝气的经营团队，引进国际先进的经营理念和管理经验，具备卓越的管理水平和执行力。 公司立足于以品牌管理和资源整合作为核心竞争能力，开辟医用级卫生棉品蓝海，缔造中国医用级卫生棉品领军企业，励志成为中国最受女性信赖的卫生棉品制造商。</p>\r\n<br >\r\n<p>2011年6月，作为株洲千金药业股份有限公司的子公司湖南千金卫生用品股份有限公司正式组建成立，是千金药业“十二五”计划中“品牌千金”的重要战略部署，打造医用级棉品专属的品牌——千金净雅，逐步形成具有千金特色的品牌群体。将“千金老字号”和“新品牌”有效结合，共塑“品牌千金”。\r\n据了解,品牌化战略促使千金净雅被视作千金药业实施“医转民”战略的增长引擎。目前，医药企业纷纷跳水转型，追求产品市场赢利，借助企业整体竞争优势，通过多元化品牌运营方式成就新高度。当下，以产品为导向的品牌化运营正逐渐成为医药企业在蓝海市场占据有力位置新途径。药企凭借其在健康事业领域的专业性，所投入于市场中的民用消费品无形中贴上了“安全”、“品质”等标签，获取消费者好感度</p>\r\n<br >\r\n<p>千金药业组建旗下子公司湖南千金卫生用品有限公司，无疑是其“十二五”计划中医用转民用二次跳跃的战略布局下的新引擎。</p>\r\n<br >\r\n</div>', '千金俱乐部', 'full_html');
INSERT INTO `block_custom` VALUES ('5', '<div class=\"brand_qianjinyaomian_content\" >\r\n<p>▲2010年，江端预同志任公司董事长，王琼瑶同志任公司总经理，新一届领导班子吹响了“二次创业”的号角，</p>\r\n<p>    提出了“六年四十亿”的战略目标 。</p>\r\n<p>    同年，公司被列入株洲市“5115”工程，成为株洲市重点支持发展的骨干企业 。</p>\r\n<p>    同年，投资成立“湖南千金养生坊健康品股份有限公司”，千金药业开始进入养生领域。</p>\r\n<br>\r\n<p>▲2011年3月，千金药业“春乳凝胶产业化项目”被列入“国家高新技术产业化计划项目”。</p>\r\n<p>    同年，公司销售规模达15亿元，跃居湖南省制药企业第一名 。</p>\r\n<p>    同年，千金药业投资设立湖南千金药材有限公司。</p>\r\n<br>\r\n<p>▲2012年11月，千金药业被授予“湖南省企业文化建设示范基地”荣誉称号。</p>\r\n<p>    同年，千金药业投资控股成立了“湖南千金协力药业有限公司”。</p>\r\n<p>    同年，千金药业投资控股成立了“湖南千金医用材料有限公司”。</p>\r\n<br>\r\n<p>▲2013年元月，公司迁入株洲市高新技术产业开发区栗雨工业园新址办公。</p>\r\n</div>', '品牌介绍千金药棉', 'filtered_html');
