INSERT INTO `field_revision_body` VALUES ('node', 'news', '0', '2', '2', 'und', '0', ' 3月29日下午，湖南大学设计艺术学院院长、教授何人可在长沙市博物馆报告厅为听众生动地讲解了《长沙窑与波斯瓷器》。\r\n    何教授提到，任何文化都不是孤立存在的，人类文明都是在多种文化的融合中发展的。比如长沙人引以为豪的长沙窑，在它的产生和发展中，融合了众多波斯瓷器的元素；比如马王堆中出土的精美漆器，在现在的日本仍有生产，这都是文明交流融合的结果。\r\n    何教授认为，在当今全球化的时代，世界的变化越来越快，文化的交流越来越频繁，我们应当以更加开放的眼光看待事物，这样才能与时俱进，创造更加丰富多彩的文化成果。\r\n    潇湘晨报：有人说在机械复制时代，很多艺术品失去了原有的光晕，您怎么看这次展出的这些工艺品的内涵？\r\n    何人可：这个就是刚刚许老师提到的，真正冲击人的是它们背后的故事。比如那些老电视机，几个老人家看到以后说“啊，我用这看了《霍元甲》”，想象一下，如果没有这些故事，这些东西就没有意义。所以还是人赋予了它们生命，设计既是源于人，也是为了人。\r\n    潇湘晨报：这些艺术品为什么有如此高的价值？\r\n    何人可：我做了一个很有意思的研究，得出的结论是——青花瓷其实也源于波斯。它的图案、它的原材料，都是来自波斯的，后来通过中国化之后又传到了西方。全世界这些有名的瓷厂，都生产青花瓷，而且都是从中国来的。我们到国外，看人家演示青花瓷的生产流程和工序，几乎是和我们几百年前一样的。所以这说明了一句话：“越是世界的，才越是中国的”，并不是“越是中国的，才越是世界的”。今天的长沙窑就是一个典型的案例，它源于西域，然后又回到西域，但是西域认为这是我们长沙人的制造。长沙窑这些东西，五万六千件东西现在都是无价之宝，台北故宫博物院只有两件，因为买不起。可是在古时候，那些都只是普通的生活用品。其实所有的东西都是一个全球化过程的结果。\r\n    潇湘晨报：您看这个展览，有什么感受？\r\n    何人可：觉得特别亲切。那种脚箱，我当年读大学的时候就拎着进的湖南大学，我们就是那个时代过来的。\r\n    潇湘晨报：看到了时代的变迁？\r\n    何人可：是的。前几天在北京做一个主题发言，完全讲的是互联网创业的内容，到那里去，你会感到这是二十一世纪，是互联网时代。所以今天的工业设计就是APP了。一大堆工业设计，比如相机、电话、摄像机，一个iPhone全部可以做到。去年数码相机的全球销量下降46%，我家里也有这些东西，我都不用，因为一台iPhone就够了，更好的是我现在拍了我全世界的朋友都看得到，一个iCloud全部共享了。这个时代完全不一样了。\r\n', '', 'filtered_html');
